import React from "react";
import "./BestTours.scss";
import Tour from "../TourComponent/Tour";
import AOS from "aos";
import "aos/dist/aos.css";
export default function BestTours() {
  AOS.init();
  return (
    <div
      className="best-tours"
      data-aos="fade-up"
      data-aos-anchor-placement="top-bottom"
    >
      <div className="best-tours-head">
        <h1 className="best-tours-heading">Tours nổi bật</h1>
        <a href="#" className="button">
          XEM TẤT CẢ
        </a>
      </div>
      <div className="best-tours-container">
        <Tour />
        <Tour />
        <Tour />
        <Tour />
        <Tour />
        <Tour />
      </div>
    </div>
  );
}
